import React from 'react';

export const TextWithLabel = (props) => {

    const { label, text } = props;

    return (
        <div className="p-grid p-mt-1">
            <div className="p-col-12 p-md-3 p-text-right">
                {label}:
            </div>
            <div className="p-col-12 p-md-9 p-text-left">
                {text}
            </div>
        </div>
    );
};
